public boolean canClose()
{
    boolean ret;
    FormRun callerForm = element.args().caller();
    FormDataSource callerDS;
    if (callerForm)
    {
        callerDS = callerForm.dataSource();
        if (callerDS)
        {
            callerDS.research(true);
        }
    }

    ret = super();

    return ret;
}

public RetailOperatingUnitPickerData getPickerInitParameters()
{
    // no need to pass already selected orgs so we just pass the hierarchy purpose as an init parameter for the picker.
    return RetailOperatingUnitPickerData::createInstance(HierarchyPurpose::RetailAssortment);
}

void processOperatingUnitPickerData(RetailOperatingUnitPickerData operatingUnitPickerData)
{
    RecId _omHierarchyRecId = operatingUnitPickerData.omHierarchyTypeRecId;
    Set _selectedOMInternalOrganizationIds = operatingUnitPickerData.omInternalOrganizationRecIds;
    int totalSkipped, totalActuallyAdded;

    RecordInsertList recordInsertList = new RecordInsertList(tableNum(RetailCatalogInternalOrg));
    RetailInternalOrganization  _retailInternalOrganization;
    RetailCatalogInternalOrg    _retailCatalogInternalOrg;
    OMInternalOrganization  _omInternalOrganization;

    SetEnumerator enumerators = _selectedOMInternalOrganizationIds.getEnumerator();
    while (enumerators.moveNext())
    {
        select firstonly RecId from _omInternalOrganization
        where _omInternalOrganization.RecId == enumerators.current();

        if (_omInternalOrganization)
        {
            _retailInternalOrganization = RetailInternalOrganization::findOrCreateByOMInternalOrganization(_omInternalOrganization.RecId);

            if (!RetailCatalogInternalOrg::findByCatalogAndInternalOrg(Catalog.RecId, _retailInternalOrganization.RecId))
            {
                _retailCatalogInternalOrg.InternalOrganization = _retailInternalOrganization.RecId;
                _retailCatalogInternalOrg.Catalog = Catalog.RecId;

                recordInsertList.add(_retailCatalogInternalOrg);
                totalActuallyAdded++;
            }
            else
            {
                totalSkipped++;
            }
        }
    }

    if (_selectedOMInternalOrganizationIds.elements() > 0)
    {
        recordInsertList.insertDatabase();

        Catalog_ds.research(true);

    }

    this.refreshCatalogDetails();

    eventSource.EventWriteProductsRetailCatalogDetailsProcessOperatingUnitPickerLog(
        'RetailCatalogDetails', 
        funcName(), 
        totalActuallyAdded, 
        totalSkipped);
}

public boolean canSubmitToWorkflow()
{
    CatalogManager catalogManager = CatalogManager::construct(catalog.RecId);

    return catalogManager.canSubmitToWorkflow();
}

public void catalogProductChanged()
{
    boolean hasMarked = false;
    boolean canDelete = false;
    boolean canDeleteCurrent = false;
    boolean canDeleteMarked = true;
    CatalogDisplayProductAll productAll;

    // reset delete button.
    if (!element.inViewMode())
    {
        if (currentCategoryNode && currentCategoryNode.getTreeNodeType() == RetailCatalogCategoryTreeNodeType::Uncategorized)
        {
            removeLine.enabled(true);
        }
        else
        {
            for (productAll = catalogProductAll_ds.getFirst(true); productAll; productAll = catalogProductAll_ds.getNext())
            {
                hasMarked = true;
                // When Multiple catalogs feature is enabled, user is allowed to remove products
                // from current category or any of its subcategories
                if (!isMultipleCatalogsFeatureEnabled && canDeleteMarked && ecoResCategory.RecId != productAll.Category)
                {
                    canDeleteMarked = false;
                }
            }

            if (!hasMarked)
            {
                if (catalogProductAll && (isMultipleCatalogsFeatureEnabled || catalogProductAll.Category == ecoResCategory.RecId))
                {
                    canDeleteCurrent = true;
                }
            }
            canDelete = (hasMarked && canDeleteMarked) || canDeleteCurrent;
            removeLine.enabled(canDelete);
        }
    }
}

public void checkShouldSwitchToViewMode()
{
    #Task

    // reset edit mode if the form should not be allowed to be edited
    // based on current catalog state
    if (!CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Draft) && !this.inViewMode())
    {
        shouldSwitchToViewMode = true;
        this.task(#TaskEditRecord);
    }
}

