private QueryBuildDataSource findDSProductAll()
{
    return catalogProductAll_ds.query().dataSourceTable(tableNum(CatalogDisplayProductAll));
}

private QueryBuildDataSource findDSProductCategoryNot()
{
    return catalogProduct_ds.query().dataSourceName(#CatalogDisplayProductNot);
}

private QueryBuildDataSource findEnableOrCreateDSProductCategoryNot(QueryBuildDataSource qbdsCatalogProduct)
{
    QueryBuildDataSource qbds = this.findDSProductCategoryNot();

    if (qbds == null)
    {
        qbds = qbdsCatalogProduct.addDataSource(tableNum(CatalogDisplayProductAll), #CatalogDisplayProductNot);
        qbds.addLink(fieldNum(CatalogProduct, Catalog), fieldNum(CatalogDisplayProductAll, Catalog), tableStr(CatalogProduct));
        qbds.addLink(fieldNum(CatalogProduct, Product), fieldNum(CatalogDisplayProductAll, Product), tableStr(CatalogProduct));
        qbds.joinMode(JoinMode::NoExistsJoin);
        qbds.addRange(fieldNum(CatalogDisplayProductAll, CategoryHierarchy));
    }
    else
    {
        qbds.enabled(true);
    }

    return qbds;
}

EcoResCategoryHierarchy getCategoryHierarchy()
{
    EcoResCategoryHierarchy hierarchy;
    if (hierarchyName.text())
    {
        hierarchy = EcoResCategoryHierarchy::findByName(hierarchyName.text());
    }

    return hierarchy;
}

public void init()
{
    // Verify if Multiple Catalogs feature is enabled
    isMultipleCatalogsFeatureEnabled = FeatureStateProvider::isFeatureEnabled(ChannelMultipleCatalogsFeature::instance());
    isCatalogTargetB2B = false;

    currentCategoryNode = null;
    super();

    // Set company to enable financial dimension for catalog
    DimensionEntryControl.parmCompany(Catalog.company());
    DimensionEntryControl.reactivate();

    sharedParams = RetailSharedParameters::find();
    catalog_ds.query().dataSourceTable(tableNum(CatalogTranslation)).addRange(fieldNum(CatalogTranslation, Language)).value(SystemParameters::getSystemLanguageId());
    this.initCategoryProductDataSource();

    isMCRCallCenterConfigEnabled = isConfigurationkeyEnabled(configurationKeyNum(MCRCallCenter));

    if(FeatureStateProvider::isFeatureEnabled(RetailEnableDisplayOrderForMerchandisingFeature::instance()))
    {
        this.initializeDisplayOrderControls();
    }
    this.setupFallbackProductTranslation();
    this.runRootData();

    this.setPriceGroupsButtonVisibility();
}

private void setPriceGroupsButtonVisibility()
{
    MenuItemButtonPriceGroups.visible(!RetailPricingFeatureToggle::isRetailPricingPropertyFeatureEnabled());
}

private void setupFallbackProductTranslation()
{
    List fallbackStringControls = new List(Types::Integer);
    List ecoResProductTranslationStringControls = new List(Types::Integer);

    ecoResProductTranslationStringControls.addEnd(element.controlId(formControlStr(RetailCatalogDetails, TranslationName)));
    fallbackStringControls.addEnd(element.controlId(formControlStr(RetailCatalogDetails, EcoResProductTranslationFallbackView_Name)));

    EcoResProductTranslationFallbackViewModel::setupFallbackTranslationForm(element,
                                                                            element.EcoResProductTranslationFallbackView_ds,
                                                                            element.EcoResProduct_ds,
                                                                            fallbackStringControls,
                                                                            ecoResProductTranslationStringControls);
}

void initializeDisplayOrderControls()
{
    // Hide/show Standard fields
    ecoResCategory_DisplayOrder.visible(true);
    catalogProduct_DisplayOrder.visible(true);

    // Enable/disable Standard fields
    productLineGrid.allowEdit(true);
    productNumber.allowEdit(false);
    translationName.allowEdit(false);
    hasRelatedProducts.allowEdit(false);

    // hide/show Retail Commerce feature fields
    CatalogCustomerHierarchyGroup.visible(isCatalogTargetB2B ? true : false);
    CatalogAttributeMetadataGroup.visible(isCatalogTargetB2B ? true : false);
    Catalog_CategoryHierarchyName.visible(isMultipleCatalogsFeatureEnabled ? true : false);
    CategoryHierarchyName.visible(isCatalogTargetB2B ? true : false);
    Catalog_CatalogTarget.visible(isMultipleCatalogsFeatureEnabled ? true : false);
    Catalog_CatalogTargetSwitch.visible(isMultipleCatalogsFeatureEnabled ? true : false);
}

private void initCategoryProductDataSource()
{
    // Query CatalogProductAll to return all products for the current catalog / category hierarchy
    QueryBuildDataSource qbdsAll, qbdsCategoryLookup;
    qbdsAll = catalogProductAll_ds.query().dataSourceTable(tableNum(CatalogDisplayProductAll));
    qbdsAll.addDynalink(fieldNum(CatalogDisplayProductAll, Catalog), catalogProduct, fieldNum(CatalogProduct, Catalog));
    qbdsAll.addDynalink(fieldNum(CatalogDisplayProductAll, Product), catalogProduct, fieldNum(CatalogProduct, Product));
    qbdsAll.addRange(fieldNum(CatalogDisplayProductAll, CategoryHierarchy));

    // Query to return dynamic contained categories inside a catalog category (TreeView category children from a parent category node)
    qbdsCategoryLookup = categoryLookup_ds.query().dataSourceTable(tableNum(RetailCategoryContainmentLookup));
    qbdsCategoryLookup.addDynalink(fieldNum(RetailCategoryContainmentLookup, ContainedCategory), catalogProductAll, fieldNum(CatalogDisplayProductAll, Category));
    qbdsCategoryLookup.addRange(fieldNum(RetailCategoryContainmentLookup, Category));
}

private void initializeCategoryHierarchy()
{
    EcoResCategoryHierarchy channelHierarchy;
    RetailCatalogCategoryHierarchy  catalogCategoryHierarchy;

    if (isCatalogTargetB2B)
    {
        // Select category Hierarchy from the Catalog table
        EcoResCategoryHierarchy catalogHierarchy = EcoResCategoryHierarchy::find(CategoryHierarchyId.value());

        // Update Tree view Category Hierarchy
        hierarchyName.text(catalogHierarchy.Name);
        hierarchyName.viewEditMode(ViewEditMode::View);

        // Update UI Catalog category Hierarchy Name field
        CategoryHierarchyName.text(catalogHierarchy.Name);
    }
    else
    {
        // Select Category hierarchy from first channel assigned to the catalog
        select firstonly CategoryHierarchy from catalogCategoryHierarchy where catalogCategoryHierarchy.Catalog == Catalog.RecId;

        if (catalogCategoryHierarchy.CategoryHierarchy)
        {
            channelHierarchy = EcoResCategoryHierarchy::find(catalogCategoryHierarchy.CategoryHierarchy);
            hierarchyName.text(channelHierarchy.Name);
            hierarchyName.viewEditMode(ViewEditMode::Edit);
            CategoryHierarchyName.text(channelHierarchy.Name);
        }
        else
        {
            hierarchyName.text('');
            hierarchyName.viewEditMode(ViewEditMode::View);
            CategoryHierarchyName.text('');
        }
    }
}

void initializeCategoryTree()
{
    EcoResCategoryHierarchy categoryHierarchy = this.getCategoryHierarchy();

    if (categoryHierarchy)
    {
        categoryTree.visible(true);
        mHierarchyTree = RetailCatalogCategoryTree::construct(hierarchyTreeCtrl, categoryHierarchy.RecId);

        mHierarchyTree.buildLazyTreeRoot(catalogTranslation.FriendlyName);
    }
    else
    {
        categoryTree.visible(false);
    }

    this.runRootData();
}

void refreshCatalogDetails()
{
    this.initializeDisplayOrderControls();
    this.initializeCategoryHierarchy();
    this.initializeCategoryTree();
    this.resetButtons();
}

/// <summary>
/// Resets the button on the form based on the current catalog definition.
/// </summary>
/// <remarks>
/// This method should not be called by external callers.
/// </remarks>
public void resetButtons()
{
    RetailCatalogInternalOrg catalogInternalOrg;
    CatalogProduct localCatalogProduct;

    boolean canEdit = !this.inViewMode() &&
                    CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Draft);

    editButton = element.control(element.controlId(#SystemDefinedViewEditButton)) as FormCommandButtonControl;
    editButton.enabled(CatalogStateTransitionValidator::canEnableEditButton(catalog));

    publishButton.enabled(CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Published));

    deleteButton.enabled(CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Deleted));
    validate.enabled(CatalogStateTransitionValidator::canEnableValidationButton(catalog));
    ViewResults.enabled(CatalogStateTransitionValidator::canViewValidationReport(catalog));

    // Enable disable Set Attribute Metadata button for eCommerce Multiple Catalog feature
    AttributeMetadataButton.enabled(isCatalogTargetB2B && CatalogStateTransitionValidator::canEnableSetAttributeMetadataButton(Catalog));

    ExplodeVariantsButton.enabled(isMultipleCatalogsFeatureEnabled && canEdit);
    productActionButtonGroup.enabled(canEdit);

    channelActionButtonGroup.enabled(canEdit);
    channelAlwaysEnabledButtons.enabled(true);

    retract.enabled(CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Retracted));
    activate.enabled(CatalogStateTransitionValidator::canEnableActivateButton(catalog));
    inactivate.enabled(CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Inactive));

    select firstonly RecId from catalogInternalOrg where catalogInternalOrg.Catalog == catalog.RecId;
    select firstonly RecId from localCatalogProduct where localCatalogProduct.Catalog == catalog.RecId;

    priceList.enabled(catalogInternalOrg.RecId);
    mcrCatalogFreeProduct.enabled(canEdit && catalogInternalOrg.RecId);

    addRetailProductsButton.enabled(canEdit && catalogInternalOrg);
    removeProductsButton.enabled(canEdit && localCatalogProduct);

    CallCenterGroup.enabled(canEdit);

    MCRSourceCodeActionButtonGroup.enabled(canEdit);

    ScriptLineButtonGroup.enabled(canEdit);

    ProductUpSellCrossSell.enabled(canEdit && localCatalogProduct);
    MCRCatalogProductPage.enabled(canEdit && localCatalogProduct);
    MCRMessageAssociationButton.enabled(canEdit && localCatalogProduct);

    // Disable listings on B2B catalogs
    RetailCatalogProductListingButton.visible(!isCatalogTargetB2B);
    RetailCatalogChannelListingButton.visible(!isCatalogTargetB2B);
}

public void run()
{
    super();

    this.refreshCatalogDetails();
}

int runCategoryTree(RecId categoryId)
{
    CatalogDisplayProductAll catalogProductAllLocal;
    RetailCategoryContainmentLookup categoryContainmentLookupLocal;

    // show category and products fast tabs only.
    headerView.visible(false);
    channelLineView.visible(isCatalogTargetB2B ? true : false);
    addRetailProductsButton.enabled(false);
    removeProductsButton.enabled(false);
    ExplodeVariantsButton.enabled(false);

    categoryHeader.visible(true);
    productLineView.visible(true);

    addProductsButton.visible(true);
    moveCategoryButton.visible(false);

    // disable the translation button
    catalogTranslateButton.enabled(false);

    if (isMCRCallCenterConfigEnabled)
    {
        mcrCatalogPage.enabled(false);
        mcrInstallmentSetup.enabled(false);
        mcrCatalogFreeProduct.enabled(false);
        mcrSourceCodeLineView.visible(false);
    }
    mcrScripts.visible(false);
    financialDimensions.visible(false);

    // update the category query
    Query qCategory = ecoResCategory_ds.query();
    QueryBuildDataSource qbdsCategory = qCategory.dataSourceTable(tableNum(EcoResCategory));
    QueryBuildDataSource qbdsCategoryTranslation = qCategory.dataSourceTable(tableNum(EcoResCategoryTranslation));
    qbdsCategoryTranslation.addRange(fieldNum(EcoResCategoryTranslation, LanguageId)).value(SystemParameters::getSystemLanguageId());
    QueryBuildRange categoryRange = SysQuery::findOrCreateRange(qbdsCategory, fieldNum(EcoResCategory, RecId));
    categoryRange.value(queryValue(categoryId));
    ecoResCategory_ds.executeQuery();

    // disable filter for uncategorized catalog products.
    Query qProducts = catalogProduct_ds.query();
    QueryBuildDataSource qbds = qProducts.dataSourceTable(tableNum(CatalogProduct));
    QueryBuildDataSource qbdsProductCategoryNot = this.findDSProductCategoryNot();
    if (qbdsProductCategoryNot != null)
    {
        qbdsProductCategoryNot.enabled(false);
    }

    // enable filter by catalog products from a given category (categoryId)
    ecoResCategoryContained_Name.visible(true);
    EcoResCategory category = EcoResCategory::find(categoryId);
    QueryBuildDataSource qbdsAll = this.findDSProductAll();
    qbdsAll.enabled(true);
    QueryBuildRange hierarchyRange = qbdsAll.findRange(fieldNum(CatalogDisplayProductAll, CategoryHierarchy));
    hierarchyRange.value(queryValue(category.CategoryHierarchy));

    // enable query to return children categories from a given parent category (categoryId)
    QueryBuildDataSource qbdsCategoryLookup = categoryLookup_ds.query().dataSourceTable(tableNum(RetailCategoryContainmentLookup));
    qbdsCategoryLookup.enabled(true);
    QueryBuildRange categoryRange4Products = qbdsCategoryLookup.findRange(fieldNum(RetailCategoryContainmentLookup, Category));
    categoryRange4Products.value(queryValue(categoryId));

    // Execute datasource queries
    catalogProduct_ds.executeQuery();
    catalogProductAll_ds.executeQuery();
    categoryLookup_ds.executeQuery();

    // return total count
    select count(RecId) from catalogProductAllLocal
        where catalogProductAllLocal.Catalog == Catalog.RecId
            && catalogProductAllLocal.CategoryHierarchy == category.CategoryHierarchy
    exists join categoryContainmentLookupLocal
        where categoryContainmentLookupLocal.Category == category.RecId
            && categoryContainmentLookupLocal.ContainedCategory == catalogProductAllLocal.Category;

    return any2int(catalogProductAllLocal.RecId);
}

void runRootData()
{
    CatalogDisplayProductAll catalogProductAllLocal;

    headerView.visible(true);
    channelLineView.visible(true);
    categoryHeader.visible(false);
    productLineView.visible(isCatalogTargetB2B);
    moveCategoryButton.visible(false);

    if (isMCRCallCenterConfigEnabled)
    {
        mcrCatalogPage.enabled(true);
        mcrInstallmentSetup.enabled(true);
        mcrCatalogFreeProduct.enabled(true);
        mcrSourceCodeLineView.visible(true);
    }
    mcrScripts.visible(true);
    financialDimensions.visible(true);
    this.resetButtons();

    if (isCatalogTargetB2B)
    {
        // For eCommerce Multiple Catalogs, the Products tab page is available at the root of the Tree.

        // Get ROOT node for the category Hierarchy
        EcoResCategory category = EcoResCategory::getRoot(CategoryHierarchyId.value());

        // update the category query filtering it by ROOT node
        Query qCategory = ecoResCategory_ds.query();
        QueryBuildDataSource qbdsCategory = qCategory.dataSourceTable(tableNum(EcoResCategory));
        QueryBuildDataSource qbdsCategoryTranslation = qCategory.dataSourceTable(tableNum(EcoResCategoryTranslation));
        qbdsCategoryTranslation.addRange(fieldNum(EcoResCategoryTranslation, LanguageId)).value(SystemParameters::getSystemLanguageId());
        QueryBuildRange categoryRange = SysQuery::findOrCreateRange(qbdsCategory, fieldNum(EcoResCategory, RecId));
        categoryRange.value(queryValue(category.RecId));
        ecoResCategory_ds.executeQuery();

        // disable filter for uncategorized catalog products.
        Query qProducts = catalogProduct_ds.query();
        QueryBuildDataSource qbds = qProducts.dataSourceTable(tableNum(CatalogProduct));
        QueryBuildDataSource qbdsProductCategoryNot = this.findDSProductCategoryNot();
        if (qbdsProductCategoryNot != null)
        {
            qbdsProductCategoryNot.enabled(false);
        }

        // enable filter by catalog products from ROOT category (ALL Products)
        ecoResCategoryContained_Name.visible(true);
        QueryBuildDataSource qbdsAll = this.findDSProductAll();
        qbdsAll.enabled(true);
        QueryBuildRange hierarchyRange = qbdsAll.findRange(fieldNum(CatalogDisplayProductAll, CategoryHierarchy));
        hierarchyRange.value(queryValue(category.CategoryHierarchy));

        // enable query to filter all children categories from the ROOT node 
        QueryBuildDataSource qbdsCategoryLookup = categoryLookup_ds.query().dataSourceTable(tableNum(RetailCategoryContainmentLookup));
        qbdsCategoryLookup.enabled(true);
        QueryBuildRange categoryRange4Products = qbdsCategoryLookup.findRange(fieldNum(RetailCategoryContainmentLookup, Category));
        categoryRange4Products.value(queryValue(category.RecId));

        // Execute datasource queries
        catalogProduct_ds.executeQuery();
        catalogProductAll_ds.executeQuery();
        categoryLookup_ds.executeQuery();
    }
    else
    {
        // For Legacy Catalogs, the Products tab page is NOT available at the root of the Tree.

        // disable filter of catalog products by category. 
        QueryBuildDataSource qbdsAll = this.findDSProductAll();
        if (qbdsAll != null)
        {
            qbdsAll.enabled(false);
        }

        // disable filter for uncategorized catalog products.
        QueryBuildDataSource qbdsProductCategoryNot = this.findDSProductCategoryNot();
        if (qbdsProductCategoryNot != null)
        {
            qbdsProductCategoryNot.enabled(false);
        }

        // Execute datasource queries
        catalogProduct_ds.executeQuery();
        catalogProductAll_ds.executeQuery();
    }

}

public int runUncategorizedData()
{
    Query qHierarchy;
    QueryBuildDataSource qbds, qbdsAll, qbdsProductCategoryNot, qbdsHierarchy;
    QueryBuildRange hierarchyRange, hierarchyRange2;
    EcoResCategoryHierarchy hierarchy = this.getCategoryHierarchy();

    CatalogProduct catalogProductLocal;
    CatalogDisplayProductAll catalogProductAllLocal;

    headerView.visible(false);
    channelLineView.visible(false);
    addRetailProductsButton.enabled(false);
    removeProductsButton.enabled(false);
    ExplodeVariantsButton.enabled(false);
    categoryHeader.visible(false);
    productLineView.visible(true);

    addProductsButton.visible(false);
    moveCategoryButton.visible(true);

    // disable the translation button
    catalogTranslateButton.enabled(false);

    if (isMCRCallCenterConfigEnabled)
    {
        mcrCatalogPage.enabled(false);
        mcrInstallmentSetup.enabled(false);
        mcrCatalogFreeProduct.enabled(false);
        mcrSourceCodeLineView.visible(false);
    }
    mcrScripts.visible(false);
    financialDimensions.visible(false);

    // disable filter of catalog products by category
    ecoResCategoryContained_Name.visible(false);
    qbdsAll = this.findDSProductAll();
    if (qbdsAll != null)
    {
        qbdsAll.enabled(false);
    }

    // enable filter for uncategorized catalog products 
    qbds = catalogProduct_ds.query().dataSourceTable(tableNum(CatalogProduct));
    qbdsProductCategoryNot = this.findEnableOrCreateDSProductCategoryNot(qbds);

    hierarchyRange = qbdsProductCategoryNot.findRange(fieldNum(CatalogDisplayProductAll, CategoryHierarchy));
    hierarchyRange.value(queryValue(hierarchy.RecId));

    // Execute datasource queries
    catalogProduct_ds.executeQuery();
    catalogProductAll_ds.executeQuery();

    // set up the hierarchy filter for 'Move' menu item
    qHierarchy = ecoResCategoryHierarchy_ds.query();
    qbdsHierarchy = qHierarchy.dataSourceTable(tableNum(EcoResCategoryHierarchy));
    hierarchyRange2 = qbdsHierarchy.findRange(fieldNum(EcoResCategoryHierarchy, RecId));
    if (hierarchyRange2 == null)
    {
        hierarchyRange2 = qbdsHierarchy.addRange(fieldNum(EcoResCategoryHierarchy, RecId));
    }
    hierarchyRange2.value(queryValue(hierarchy.RecId));

    ecoResCategoryHierarchy_ds.executeQuery();

    // return total count
    select count(RecId) from catalogProductLocal
        where catalogProductLocal.Catalog == Catalog.RecId
    notexists join catalogProductAllLocal
        where catalogProductAllLocal.Catalog == Catalog.RecId
            && catalogProductAllLocal.Product == catalogProductLocal.Product
            && catalogProductAllLocal.CategoryHierarchy == hierarchy.RecId
    ;

    return any2int(catalogProductLocal.RecId);
}

public int task(int _taskId)
{
    #Task

    int ret;
    Args args = new Args(element);
    MenuFunction menuFunction;

    // if in edit mode and we are suppose to switch to view mode
    if ((_taskId == #TaskEditRecord || _taskId == #taskRightClickEditRecord) && !this.inViewMode())
    {
        if (shouldSwitchToViewMode)
        {
            element.resetButtons();
            shouldSwitchToViewMode = false;

            ret = super(_taskId);
            return ret;
        }
    }

    if ((_taskId == #TaskEditRecord || _taskId == #taskRightClickEditRecord) && this.inViewMode())
    {
        menuFunction = new MenuFunction(menuitemActionStr(CatalogEdit), MenuItemType::Action);

        args.record(Catalog);
        args.parmEnumType(enumNum(CatalogUIActionType));
        args.parmEnum(enum2int(CatalogUIActionType::Edit));
        menuFunction.run(args);

        Catalog_DS.reread();

        if (CatalogStateTransitionValidator::canTransition(catalog, CatalogState::Draft))
        {
            element.resetButtons();
        }
        else
        {
            // Avoid going into edit mode.
            return 0;
        }
    }
    else if (catalogProduct && _taskId == #taskDeleteRecord)
    {
        catalogProduct_ds.write();
    }

    ret = super(_taskId);

    if (_taskId == #TaskEditRecord || _taskId == #taskDeleteRecord)
    {
        this.resetButtons();
    }

    return ret;
}

/// <summary>
/// Customizes the options used to populate the Office Menu.
/// </summary>
/// <param name = "_menuOptions">The menu options to be customized.</param>
public void customizeMenuOptions(OfficeMenuOptions _menuOptions)
{
    // The user can open in excel to view data when catalog is in view mode, but she will get errors when she tries to publish changes back which ensures she does not mess up with published catalogs w/o first explicitly convert the catalog to draft state.
    OfficeTemplateExportMenuItem menuItem = OfficeTemplateExportMenuItem::construct(OfficeAppApplicationType::Excel, resourceStr(RetailProductAttributeValueEditableExportTemplate));
    menuItem.displayName("@Retail:ProductAttributeValueBulkEditExportOptionName");
    _menuOptions.customMenuItems().addEnd(menuItem);
}

/// <summary>
/// Gets the set of initial filters to be applied to the template.
/// </summary>
/// <returns>
/// The Map of filters to apply.
/// Keyed by AOT entity name.
/// Values are all Microsoft.Dynamics.Platform.Integration.Office.FilterNode instances.
/// </returns>
/// <remarks>
/// The filters supplied here will override any filters currently in the template.
/// If no filter is suppled for a given entity, any filters currently in the template are retained.
/// </remarks>
public Map getInitialTemplateFilters(OfficeTemplateExportMenuItem _menuItem)
{
    Map filters = new Map(Types::String, Types::Class);

    if (_menuItem.id() == OfficeExportMenuItem::DefaultId)
    {
        RetailTmpBulkProductAttributeValue::refreshFromCatalog(catalog.RecId, element.getCategoryHierarchy().RecId, currentCategoryNode);
        filters.insert(tableStr(RetailTmpBulkProductAttributeValueEntity), element.getExportToExcelFilter());
    }

    return filters;
}

