public void write()
{
    if (!isCatalogTargetB2B)
    {
        // Test if catalog target has changed from B2B to B2C
        if (catalog.CatalogTarget != Catalog.orig().CatalogTarget)
        {
            // Remove the catalog associations with customer hierarchies
            if (isMultipleCatalogsFeatureEnabled && (Box::yesNo("@Retail:CatalogCustHierarchyRemoval", DialogButton::No, "@SYS89156") == DialogButton::Yes))
            {
                CustHierarchyCatalog custHierarchyCatalog;
                delete_from custHierarchyCatalog where custHierarchyCatalog.CatalogRefRecId == catalog.RecId;
            }
            else
            {
                return;
            }
        }

        // clear category hierarchy
        catalog.CategoryHierarchy = 0;
    }

    // Save record
    super();
    catalogTranslation_ds.write();
}

