private void addCatalogQueryRanges()
{
    Common callerRecord  = element.args().record();
    boolean foundCatalog = false;

    // Adds the filter range on the Catalog if calls from any Retail Channel: Store, Online stores, Call Center, etc.
    if (FormDataUtil::isFormDataSource(callerRecord) && (callerRecord is RetailChannelTable))
    {
        RetailCatalogInternalOrg catalogInternalOrg;
        RetailInternalOrganization  internalOrg;
        RetailChannelTable channel;

        // find catalog for selected channel.
        while select catalogInternalOrg
        join internalOrg
            where catalogInternalOrg.InternalOrganization == internalOrg.RecId
        exists join channel
            where channel.OMOperatingUnitID == internalOrg.InternalOrganization &&
                channel.RecId == callerRecord.RecId
        {
            foundCatalog = true;
            this.query().dataSourceTable(tableNum(catalog)).addRange(fieldNum(Catalog, RecId)).value(queryValue(catalogInternalOrg.Catalog));
        }

        if (!foundCatalog)
        {
            this.query().dataSourceTable(tableNum(catalog)).addRange(fieldNum(Catalog, RecId)).value(queryValue(0));
        }
    }
    else if (FormDataUtil::isFormDataSource(callerRecord) && (callerRecord is EcoResProduct))
    {
        CatalogProduct catalogProductForFilter;

        while select Product, Catalog from catalogProductForFilter 
            group by catalogProductForFilter.Product, catalogProductForFilter.Catalog
            where catalogProductForFilter.Product == callerRecord.RecId
        {
            foundCatalog = true;
            this.query().dataSourceTable(tableNum(catalog)).addRange(fieldNum(Catalog, RecId)).value(queryValue(catalogProductForFilter.Catalog));
        }

        if (!foundCatalog)
        {
            this.query().dataSourceTable(tableNum(catalog)).addRange(fieldNum(Catalog, RecId)).value(queryValue(0));
        }
    }
}

