/// <summary>
/// Displays the organization name.
/// </summary>
/// <param name="_omInternalOrganization">
/// A buffer of table <c>OMInternalOrganization</c> to show org name.
/// </param>
/// <returns>
/// The organization name.
/// </returns>
public display Name organizationTypeName(OMInternalOrganization _omInternalOrganization)
{
    Name orgTypeName;
    OMOperatingUnit  omOperatingUnitLocal;
    RetailChannelTable  retailChannelTableLocal;

    omOperatingUnitLocal = OMOperatingUnit::find(_omInternalOrganization.RecId, OMOperatingUnitType::OMAnyOU);

    if (omOperatingUnitLocal)
    {
        // If Operating unit type is RetailChannel then find the RetailChannel sub type else return the Operating unit type name.
        if (omOperatingUnitLocal.omOperatingUnitType == OMOperatingUnitType::RetailChannel)
        {
            retailChannelTableLocal = RetailChannelTable::findByOperatingUnitId(omOperatingUnitLocal.RecId);

            if (retailChannelTableLocal)
            {
                orgTypeName = enum2str(retailChannelTableLocal.ChannelType);
            }
        }
        else
        {
            orgTypeName = enum2str(omOperatingUnitLocal.omOperatingUnitType);
        }
    }
    else
    {
        orgTypeName = enum2str(_omInternalOrganization.OrganizationType);
    }

    return orgTypeName;
}

