public void lookup()
{
    SysTableLookup sysTableLookup;

    Query q;
    QueryBuildDataSource qbdsHierarchyInternalOrg, qbdsCatalogCategoryHierarchyCurrent;
    QueryBuildRange catalogRange;

    QueryBuildFieldList internalOrgFields;

    // Custom query: union of retail hierarchy and catalog channel hierarchies.
    q = new Query();

    qbdsHierarchyInternalOrg = q.addDataSource(tableNum(EcoResCategoryHierarchy), #HierarchyChannel);
    internalOrgFields = qbdsHierarchyInternalOrg.fields();

    internalOrgFields.clearFieldList();
    // This is to match sysTableLookup.addLookupfield which adds it to qbdsHierarchyRetail later.
    internalOrgFields.addField(fieldNum(EcoResCategoryHierarchy, Name));

    qbdsCatalogCategoryHierarchyCurrent = qbdsHierarchyInternalOrg.addDataSource(tableNum(RetailCatalogCategoryHierarchy), tableStr(RetailCatalogCategoryHierarchy));
    qbdsCatalogCategoryHierarchyCurrent.addLink(fieldNum(EcoResCategoryHierarchy, RecId), fieldNum(RetailCatalogCategoryHierarchy, CategoryHierarchy), #HierarchyChannel);
    qbdsCatalogCategoryHierarchyCurrent.joinMode(JoinMode::ExistsJoin);
    catalogRange = qbdsCatalogCategoryHierarchyCurrent.addRange(fieldNum(RetailCatalogCategoryHierarchy, Catalog));
    catalogRange.value(queryValue(catalog.RecId));

    sysTableLookup = SysTableLookup::newParameters(tableNum(EcoResCategoryHierarchy), this);
    sysTableLookup.addLookupfield(fieldNum(EcoResCategoryHierarchy, Name));
    sysTableLookup.parmQuery(q);
    sysTableLookup.performFormLookup();
}

