private void fixProductCount(FormTreeItem _oldItem, FormTreeItem _newItem, int _rowCount)
{
    RetailCatalogCategoryTreeNode newNode, oldNode;
    Name labelText;

    if (_oldItem)
    {
        oldNode = _oldItem.data();
        if (oldNode)
        {
            labelText = oldNode.getNodeName();
            // the text is just the category name.
            _oldItem.text(labelText);
            this.setItem(_oldItem);
        }
    }

    newNode = _newItem.data();
    labelText = newNode.getNodeNameWithCount(_rowCount);
    // the text is just the category name plus the count.
    _newItem.text(labelText);
    this.setItem(_newItem);
}

public void selectionChanged(FormTreeItem _oldItem, FormTreeItem _newItem, FormTreeSelect _how)
{
    int rowCount = 0;
    RetailCatalogCategoryTreeNode oldNode;
    Name labelText;

    super(_oldItem, _newItem, _how);

    if (mHierarchyTree)
    {
        currentCategoryNode = _newItem.data();
        switch (currentCategoryNode.getTreeNodeType())
        {
            case RetailCatalogCategoryTreeNodeType::Category:
                rowCount = element.runCategoryTree(currentCategoryNode.getCategoryRecId());
                break;
            case RetailCatalogCategoryTreeNodeType::Uncategorized:
                rowCount = element.runUncategorizedData();
                break;
            case RetailCatalogCategoryTreeNodeType::Root:
                element.runRootData();
                break;
        }

        labelText = currentCategoryNode.getNodeNameWithCount(rowCount);
        // the text is just the category name plus the count.
        _newItem.text(labelText);
        this.setItem(_newItem);
    }
}

public boolean expanding(int _Idx, FormTreeExpand _action, anytype _data)
{
    boolean ret;

    if (mHierarchyTree && _action == FormTreeExpand::Expand)
    {
        mHierarchyTree.buildLazySubTree(_idx);
        ret = super(_Idx, _action, _data);
    }

    return ret;
}

