{
    SysTableLookup sysTableLookup = SysTableLookup::newParameters(tableNum(EcoResCategoryHierarchy), this);
    Query query = new Query();
    QueryBuildDataSource queryBuildDataSource;
    queryBuildDataSource = query.addDataSource(tableNum(EcoResCategoryHierarchy));
    queryBuildDataSource = queryBuildDataSource.addDataSource(tableNum(EcoResCategoryHierarchyRole));
    queryBuildDataSource.joinMode(JoinMode::InnerJoin);
    queryBuildDataSource.relations(true);
    queryBuildDataSource.addRange(fieldNum(EcoResCategoryHierarchyRole, NamedCategoryHierarchyRole)).value(queryValue(EcoResCategoryNamedHierarchyRole::RetailChannelNavigation));

    sysTableLookup.addLookupfield(fieldNum(EcoResCategoryHierarchy, Name));
    sysTableLookup.addSelectionfield(fieldNum(EcoResCategoryHierarchy, Name));
    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

/// <summary>
/// Executes logic when a category Hierarchy is changed for a given catalog.
/// </summary>
/// <returns>True if the field was successfully modified. False otherwise.</returns>
public boolean modified()
{
    // Executes the category hierarchy update
    boolean ret = super();

    // Initialize new category tree
    EcoResCategoryHierarchyId newId = EcoResCategoryHierarchy::findByName(CategoryHierarchyName.text()).RecId;
    Catalog.CategoryHierarchy = newId;
    CategoryHierarchyId.value(newId);
    HierarchyName.text(CategoryHierarchyName.text());
    element.initializeCategoryTree();

    // populate Catalog category attributes on table <c>RetailCatalogCategoryAttributes<c>
    RetailCatalogCategoryAttribute::populateCatalogCategoryAttributes(Catalog.RecId, newId);

    return ret;
}

