void clicked()
{
    CatalogProduct  markedCatalogProduct;
    CatalogManager manager = CatalogManager::construct(catalog.RecId);
    boolean hasMarked = false;

    // super();

    if (Box::yesNo("@RET4040027", DialogButton::Yes) == DialogButton::No)
    {
        return;
    }

    ttsbegin;
    for (markedCatalogProduct = catalogProduct_ds.getFirst(true) ? catalogProduct_ds.getFirst(true) : catalogProduct_ds.cursor(); markedCatalogProduct; markedCatalogProduct = catalogProduct_ds.getNext())
    {
        if (currentCategoryNode && currentCategoryNode.getTreeNodeType() == RetailCatalogCategoryTreeNodeType::Uncategorized)
        {
            manager.removeProductsFromCategory(markedCatalogProduct.Product, element.getCategoryHierarchy().RecId, 0);
        }
        else
        {
            if (isMultipleCatalogsFeatureEnabled)
            {
                // remove products from the current category or subcategories 
                manager.removeProductsFromCategory(markedCatalogProduct.Product, catalogProductAll.CategoryHierarchy, catalogProductAll.Category);
            }
            else
            {
                // remove products only from current category
                manager.removeProductsFromCategory(markedCatalogProduct.Product, EcoResCategory.CategoryHierarchy, EcoResCategory.RecId);
            }
        }
    }
    ttscommit;

    catalogProduct_ds.research();
}

